var products = [
    {
        name: "Chleb",
        price: 3.50
    },
    {
        name: "Mydło",
        price: 5.00
    }
];

function mapToLi() {
    return products.map(product => {
        return (
            <li>{product.name}, {product.price}</li>
        );
    });
}

function Products() {
    return (
        <div>
            <ul>{mapToLi()}</ul>
        </div>
    );
}

export default Products;
